import { createReducer, on } from '@ngrx/store';
import { ElementList } from 'app/interfaces/bootstrap';
import { savePlayers, addPicks} from '../State/compareActions';

interface State {
  elements: ElementList;
}

const jobStatusre = createReducer(
  initialState,
  on(savePlayers, (state, action) => ({
    ...state,
    elements: action.elements
  }))
);
